import React from 'react';
import {Form} from 'antd'

const dummy = {
  isLoggedIn:true,
  imagePaths:[]
};

const Home = () =>{
    return (
        <div>
            {dummy.isLoggedIn && <Form encType = "multipart/form-data"></Form>}
            <Input.TextArea maxLength = {150} placecholder = "어떤 일이 있었나요"></Input.TextArea>
        </div>
    );
};

export default Home;
